import React, { useState } from 'react';
import { useParams, useLocation, useNavigate } from 'react-router-dom';
import { Calendar, Users, MessageSquare } from 'lucide-react';
import './BookNow.css';

function BookNow() {
  const { id } = useParams();
  const location = useLocation();
  const navigate = useNavigate();
  const roomDetails = location.state?.roomDetails;

  const [bookingData, setBookingData] = useState({
    moveInDate: '',
    leaseDuration: '6',
    occupants: 1,
    message: '',
  });

  if (!roomDetails) {
    navigate('/');
    return null;
  }

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setBookingData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Booking request submitted:', { roomId: id, ...bookingData });
    alert('Your rental request has been submitted successfully! The landlord will contact you soon.');
    navigate('/');
  };

  return (
    <div className="book-now-page">
      <div className="book-now-container">
        <div className="book-now-header">
          <h2>Request to Rent</h2>
          <p>Please fill in the details to submit your rental request for {roomDetails.title}.</p>
        </div>
        <div className="book-now-content">
          <img src={roomDetails.image} alt={roomDetails.title} className="room-image" />
          <div className="room-details">
            <div className="room-info">
              <h3>{roomDetails.title}</h3>
              <p>Monthly Rent: Rs {roomDetails.price.toLocaleString()}</p>
              <p>{roomDetails.furnished ? 'Furnished' : 'Unfurnished'}</p>
            </div>
            <div className="amenities">
              <h4>Amenities:</h4>
              <ul>
                {roomDetails.amenities.parking && <li>Parking</li>}
                {roomDetails.amenities.wifi && <li>WiFi</li>}
                {roomDetails.amenities.water && <li>Water</li>}
              </ul>
            </div>
          </div>
          <form onSubmit={handleSubmit} className="booking-form">
            <div className="form-group">
              <label htmlFor="moveInDate">Preferred Move-in Date</label>
              <div className="date-input-wrapper">
                <Calendar className="input-icon" size={18} />
                <input
                  type="date"
                  id="moveInDate"
                  name="moveInDate"
                  value={bookingData.moveInDate}
                  onChange={handleInputChange}
                  required
                />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="leaseDuration">Lease Duration (months)</label>
              <select
                id="leaseDuration"
                name="leaseDuration"
                value={bookingData.leaseDuration}
                onChange={handleInputChange}
                required
              >
                <option value="3">3 months</option>
                <option value="6">6 months</option>
                <option value="12">12 months</option>
                <option value="24">24 months</option>
              </select>
            </div>
            <div className="form-group">
              <label htmlFor="occupants">Number of Occupants</label>
              <div className="input-wrapper">
                <Users className="input-icon" size={18} />
                <input
                  type="number"
                  id="occupants"
                  name="occupants"
                  min="1"
                  value={bookingData.occupants}
                  onChange={handleInputChange}
                  required
                />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="message">Message to Landlord</label>
              <div className="input-wrapper">
                <MessageSquare className="input-icon" size={18} />
                <textarea
                  id="message"
                  name="message"
                  rows={3}
                  value={bookingData.message}
                  onChange={handleInputChange}
                  placeholder="Introduce yourself and ask any questions you may have about the room or rental terms."
                ></textarea>
              </div>
            </div>
            <button type="submit" className="submit-button">
              Submit Rental Request
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default BookNow;
